import { Box } from "@chakra-ui/react";
import SingleChat from "./SingleChatBox";

function Rightpart({ fetchAgain , setFetchAgain}){

  return (
    <Box
      d={{ md: "flex" }}
      alignItems="center"
      flexDir="column"
      p={3}
      bg="white"
      w={{ base: "100%", md: "68%" }}
      borderRadius="lg"
      borderWidth="1px"
    >
      <SingleChat fetchAgain={fetchAgain} setFetchAgain={setFetchAgain} />}
    </Box>
  );
}

export default Rightpart;
